import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Checkout.css";

const Checkout = () => {
  const navigate = useNavigate();
  const [cartItems, setCartItems] = useState([]);
  const [formData, setFormData] = useState({
    fullName: "",
    phone: "",
    address: "",
    paymentMethod: "Карта",
  });

  useEffect(() => {
    const storedUser = JSON.parse(localStorage.getItem("user"));
    if (!storedUser?.userId) return navigate("/login");

    fetch(`http://localhost:5085/api/cart/${storedUser.userId}`)
      .then(res => res.json())
      .then(data => {
        console.log("Данные из корзины:", data);

        let items = [];

        if (Array.isArray(data)) {
          items = data;
        } else if (data && Array.isArray(data.items)) {
          items = data.items;
        }

        const parsed = items.map(item => ({
          ...item,
          productId: item.product?.productId || item.productId,
          image: item.product?.images?.[0]?.imageUrl || "/img/placeholder.png",
          name: item.product?.model || item.product?.name || "Товар",
          price: item.product?.newPrice ?? item.price ?? 0,
          quantity: item.quantity || 1,
        }));

        setCartItems(parsed);
      })
      .catch(err => {
        console.error("Ошибка загрузки корзины:", err);
        setCartItems([]);
      });
  }, [navigate]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const storedUser = JSON.parse(localStorage.getItem("user"));
    if (!storedUser?.userId) return;

    if (!Array.isArray(cartItems) || cartItems.length === 0) {
      alert("Корзина пуста или повреждена.");
      return;
    }

    const orderItems = cartItems.map(item => ({
      productId: item.productId,
      quantity: item.quantity,
      price: item.price,
    }));

    const orderData = {
      userId: storedUser.userId,
      fullName: formData.fullName,
      phone: formData.phone,
      address: formData.address,
      paymentMethod: formData.paymentMethod,
      items: orderItems,
    };

    try {
      const res = await fetch("http://localhost:5085/api/orders", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(orderData),
      });

      if (res.ok) {
        const data = await res.json();
        navigate(`/order-success?orderId=${data.orderId}`);
      } else {
        const errText = await res.text();
        alert("Ошибка при оформлении: " + errText);
      }
    } catch (err) {
      console.error("Ошибка сервера:", err);
      alert("Не удалось создать заказ.");
    }
  };

  return (
    <div className="checkout-wrapper">
      <h2>Оформление заказа</h2>
      <form className="checkout-form" onSubmit={handleSubmit}>
        <input
          type="text"
          name="fullName"
          placeholder="ФИО"
          value={formData.fullName}
          onChange={handleInputChange}
          required
        />
        <input
          type="tel"
          name="phone"
          placeholder="Телефон"
          value={formData.phone}
          onChange={handleInputChange}
          required
        />
        <input
          type="text"
          name="address"
          placeholder="Адрес доставки"
          value={formData.address}
          onChange={handleInputChange}
          required
        />
        <select
          name="paymentMethod"
          value={formData.paymentMethod}
          onChange={handleInputChange}
        >
          <option value="Карта">Картой</option>
          <option value="Наличные">Наличные</option>
        </select>

        <button type="submit" className="checkout-btn">
          Подтвердить заказ
        </button>
      </form>
    </div>
  );
};

export default Checkout;
